  [],\n\t\"revision_timestamp\": \"2015-12-20T19:02:45.286884\",\n\t\"name\": \"urvina-bay-stable-isotope-delta-18o-data-for-1600-to-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A. URVCOMP.TXT Site: Urvina Bay, Galapagos
  Islands, 00 deg 24.52 min S, 91 deg 14.04 min W. Oxygen Isotopic time series averaged
  from 2 cores-UR-86 (Pavona clavus, 1607-1953) and UR-87 (Pavona gigantea, 1962-1981).
  This data was used to construct figure 8 in the original reference. Years with no
  value are years for which no coral sample was available for analysis. Both samples
  are expressed in units of parts per mil relative to the PDB standard. To construct
  a working composite of the two data sets, a correction must be made for the species-specific
  offset between P. Clavus and P. Gigantea. Based on our studies in Galapagos (e.g.,
  Fig 6 in Dunbar, et al, 1994) and multiple sites in the eastern Pacific (Wellington
  and Dunbar, Coral Reefs, in press), P. Clavus produces aragonite about 0.40 parts
  per mil enriched in O-18 relative to P. Gigantea. This amount has been added to
  the UR-87 PDB values to produce Figure 8 in Dunbar, et al, 1994. B. URV87.DAT This
  data was used to construct Figure 5 in the annual reference, a sub-annual oxygen
  isotopic time-series spanning the period 1961-1982. The data are sub-annual del
  O-18 values, given in parts per mil relative to the PDB standard, from a colony
  of Pavona gigantea. The coral was drilled at roughly millimeter intervals; the first
  columns of file URV87.DAT give the distance of the top and bottom of the sample
  interval from the base of the colony. The column labeled Year is the inferred calendar
  period of growth for each interval.\",\n\t\"license_title\": null,\n\t\"extras\":
